import "./Welcome.css";

export default function Welcome() {
  return (
    <div className="welcome">
      <header>Welcome to my cheer info site :)</header>
      <p>
        My plan for this site is to provide all information cheer-related for
        the UK, including UK-based competitions and teams that have won bids to
        international competitions.
      </p>
    </div>
  );
}
